import React, { Component } from "react";
import "./Menuuser.css"



class Menuuser extends Component {
    constructor(props) {
        super(props);
        this.state = {
          showgrave:this.props.showgrave,
          showmydata:this.props.showmydata,
          showmyintencion:this.props.showmyintencion
            }

        
        this.handleshowgrave = this.handleshowgrave.bind(this);
        this.handlemydata = this.handlemydata.bind(this);
        this.handlemyintencion = this.handlemyintencion.bind(this);
    }
    componentDidMount = () => {}
    

    render() {
        
        return(
            <></>
        )
           
        
    }

}

export default Menuuser
